import React, { useState, useEffect } from 'react'

function App() {
    //declare variable to hold response data
    const [data, setData, dataTime, setDataTime] = useState([{}])

    useEffect(() => {
        //send http request get to backend /time
        fetch("/stock", {
            //set http request parameters
            method: 'GET',
            mode: 'cors',
            cache: 'no-cache',
            credentials: 'same-origin',
            headers: {
                'Content-Type': 'application/json'
            },
            redirect: 'follow',
            referrerPolicy: 'no-referrer'
        })
        .then(
            //parse response in json()
            res => res.json()
        )
        //give feedback if fail
        .catch((error) => {
            console.log(error)
        })
        .then(
            data => {
            //write into var
            setData(data)
            //print to console
            console.log(data)
            }
        )

        fetch("/time", {
            //set http request parameters
            method: 'GET',
            mode: 'cors',
            cache: 'no-cache',
            credentials: 'same-origin',
            headers: {
                'Content-Type': 'application/json'
            },
            redirect: 'follow',
            referrerPolicy: 'no-referrer'
        })
        .then(
            //parse response in json()
            res => res.json()
        )
        //give feedback if fail
        .catch((error) => {
            console.log(error)
        })
        .then(
            dataTime => {
            //write into var
            setData(dataTime)
            //print to console
            console.log(dataTime)
            }
        )

    //empty array to only fetch once []
    }, [])




    return (
        <div>
            <h1>Time</h1>
            {
                //check that response has some sort of value
                (typeof data === 'undefined') ? (
                    //err msg
                    <p>
                        http get request to Flask backend /stock failed, make sure Flask backend is up and running
                    </p>
                ) : (
                    //"print" value of response.json
                    <p>
                        HTTP GET response to Flask backend succeded!
                        regularMarketPrice price of stock "TSLA": { JSON.stringify(data) } <br></br>
                        Requested at time: { JSON.stringify(dataTime) } <br></br>
                    </p>
                )
            }
        </div>
    )
}

export default App
